                "groupby": [
                    "rev",
                    "actual"
                ],
                "key": "predicted",
                "value": 0
            },
            {
                "joinaggregate": [
                    {
                        "op": "max",
                        "field": "xy_count",
                        "as": "max_count"
                    }
                ],
                "groupby": []
            },
            {
                "calculate": "datum.xy_count / datum.max_count",
                "as": "percent_of_max"
            }
        ],
        "encoding": {
            "x": {
                "field": "actual",
                "type": "nominal",
                "sort": "ascending",
                "title": "actual"
            },
            "y": {
                "field": "predicted",
                "type": "nominal",
                "sort": "ascending",
                "title": "predicted"
            }
        },
        "layer": [
            {
                "mark": "rect",
                "width": 300,
                "height": 300,
                "encoding": {
                    "color": {
                        "field": "xy_count",
                        "type": "quantitative",
                        "title": "",
                        "scale": {
                            "domainMin": 0,
                            "nice": true
                        }
                    }
                }
            },
            {
                "selection": {
                    "label": {
                        "type": "single",
                        "on": "mouseover",
                        "encodings": [
                            "x",
                            "y"
                        ],
                        "empty": "none",
                        "clear": "mouseout"
                    }
                },
                "mark": "rect",
                "encoding": {
                    "tooltip": [
                        {
                            "field": "actual",
                            "type": "nominal"
                        },
                        {
                            "field": "predicted",
                            "type": "nominal"
                        }
                    ],
                    "opacity": {
                        "condition": {
                            "selection": "label",
                            "value": 1
                        },
                        "value": 0
                    }
                }
            },
            {
                "transform": [
                    {
                        "filter": {
                            "selection": "label"
                        }
                    }
                ],
                "layer": [
                    {
                        "mark": {
                            "type": "rect",
                            "color": "lightpink"
                        }
                    }
                ]
            },
            {
                "mark": "text",
                "encoding": {
                    "text": {
                        "field": "xy_count",
                        "type": "quantitative"
                    },
                    "color": {
                        "condition": {
                            "test": "datum.percent_of_max > 0.5",
                            "value": "white"
                        },
                        "value": "black"
                    }
                }
            }
        ]
    }
}
;
            vegaEmbed('#dvc_yaml__Confusion-Matrix', spec);
